(52, 'test1', '<p>sdfasdf</p><figure class=\"image\"><img style=\"aspect-ratio:1920/1280;\" src=\"http://localhost:3001/public/articleImg/articleImage-1724376932189-407631593.jfif\" width=\"1920\" height=\"1280\"></figure><p>sdqweqw</p><figure class=\"image\"><img style=\"aspect-ratio:1280/1920;\" src=\"http://localhost:3001/public/articleImg/articleImage-1724376939100-103978651.jfif\" width=\"1280\" height=\"1920\"></figure><p>&nbsp;</p>', 2, '2024-08-22 10:03:48', 0, 19, 1, 0, 0),
(53, 'saadf', '<p>111111</p><p>111ㄉㄉㄉㄉㄉㄉ</p><figure class=\"image\"><img style=\"aspect-ratio:1280/1920;\" src=\"http://localhost:3001/public/articleImg/articleImage-1724378126533-398481408.jfif\" width=\"1280\" height=\"1920\"></figure>', 1, '2024-08-23 09:40:36', 0, 64, 1, 0, 0),
(54, '職隻隻隻隻', '<p>ㄆㄍㄊㄐㄍㄐㄐㄋㄑㄑㄋ</p><p>ㄑㄑㄋ</p><figure class=\"image\"><img style=\"aspect-ratio:1280/1920;\" src=\"http://localhost:3001/public/articleImg/articleImage-1724379528242-76781225.jfif\" width=\"1280\" height=\"1920\"></figure>', 2, '2024-08-23 10:05:41', 0, 89, 1, 0, 0),
(55, '42234', '<p>哈哈哈哈哈哈</p><p>哈哈哈哈哈哈</p><p>哈哈哈哈哈哈</p><p>哈哈哈哈哈哈</p><figure class=\"image\"><img style=\"aspect-ratio:1280/1920;\" src=\"http://localhost:3005/public/articleImg/articleImage-1724641129098-875663739.jfif\" width=\"1280\" height=\"1920\"></figure>', 2, '2024-08-26 10:58:51', 650, 4, 0, 1, 0),
(59, '家中養醒型狗瑪爾濟斯需要購買寵物清淨機嗎？', '<p>我家裡養的是馬爾濟斯本身他是沒甚麼狗臭味，但平常要靠很近才聞的到～～但狗為其實也還好不是很臭的那種！而平常他幾乎也不會掉毛，幾乎沒看過她掉毛過！</p><p>這樣的話我需要買寵物用清淨機嗎？</p><p>清淨機是要買沒錯但不知需要買寵物專用清淨機嗎？</p><p>目前室友看上這款但不知有沒有寵物的功能說！</p><p>伊特萊斯ｐｅａｒＡ９和夏普FP-J80T-W</p><p>及飛利浦的毛小奈　這三款那一個比較好呢？但聽說說圓柱的清淨效果比較好是真的嗎？</p><p>附上狗照</p><figure class=\"image\"><img style=\"aspect-ratio:750/1125;\" src=\"http://localhost:3005/public/articleImg/articleImage-1725420601297-356057883.jpg\" width=\"750\" height=\"1125\"></figure>', 4, '2024-09-04 11:30:03', 9, 4, 0, 2, 0);
