INSERT INTO `hotel` (`id`, `location_id`, `name`, `description`, `address`, `latitude`, `longitude`, `main_img_path`, `price_s`, `price_m`, `price_l`, `service_food`, `service_bath`, `service_live_stream`, `service_playground`, `created_at`, `valid`) VALUES
(1, 1, 'W SPA寵物旅館', 'W SPA 寵物旅館位於台電大樓附近，以寵物美容、SPA、住宿安親服務為主，提供貓咪超大獨立挑高空間，而狗狗則採不關籠半開方式照顧，並都提供24H監視器（有夜視鏡功能），讓飼主可隨時觀看毛孩動態。消費者表示：「狗狗在這邊玩得很開心，環境乾淨」、「保姆姐姐對我們家小朋友超級好！！很仔細照顧毛孩子們」、「公館一帶，寵物住宿首選！！乾淨，有耐心，可雲端監控毛孩狀況」、「收費合理，並且很細心的照顧毛小孩」。', '台北市中正區羅斯福路三段139號1F', 25.02186590, 121.52720700, 'HT0000011.jpg,HT0000012.jpg,HT0000013.jpg', 355, 570, 780, 1, 1, 0, 1, '2024-08-29 15:01:18', 1),
(2, 1, '有間狗旅精品度假中心', '有間狗旅位於中正紀念堂站附近，強調專注狗狗房與公共空間的設計，除了備有基本的 24 小時全天候監視器外，甚至還有狗狗行為諮商師駐館，協助狗狗們快速安穩地適應環境，服務相當貼心。家長大力推薦：「老闆非常細心，對於狗狗的動向都有仔細掌握」、「整體氛圍感覺非常溫馨悠閒，老闆也非常的專業」、「環境很漂亮整潔，服務也非常專業細心」、「很用心了解寵物的喜好及需求，有問題的時候回覆也都很即時」。', '台北市中正區南昌路一段14號二樓', 25.03224660, 121.51631640, 'HT0000021.jpg,HT0000022.jpg,HT0000023.jpg', 330, 575, 677, 1, 1, 0, 1, '2024-08-29 16:12:45', 1),
(3, 1, 'VERY旺寵物旅館', 'VERY旺以打造市中心的寵物樂園為出發點，提供貓狗美容、SPA、住宿、安親臨托等，也有販售寵物用品及鮮食，旅館除了採貓狗獨立分層空間外，最大特色就是頂樓有設計戶外運動場，能讓住宿的狗狗自由自在奔跑玩耍。住過都說讚：「是真心愛寵物的寵物旅館，住宿價格很實惠，還有狗狗們的放風時間」、「每天回報狗狗狀態，可以視訊看寶貝狀況，頂樓有空地可以讓寶貝放風」、「保姆都非常細心 帶寶貝來住宿都很放心」、「服務好，對待毛寶貝們都很友善」。', '台北市松山區八德路二段429號2樓', 25.04830810, 121.54664640, 'HT0000031.jpg,,HT0000032.jpg,HT0000033.jpg', 348, 542, 735, 0, 0, 1, 1, '2024-08-29 15:00:52', 1),
(4, 1, '家裡寵物旅館-幼幼館', '家裡寵物旅館是全台唯一專門收幼犬的寵物旅館，主打為幼犬、小型犬提供寄宿、安親、美容、訓練等服務，環境相當溫馨自由，尤其在遊戲安親班的活動，更是採一對一引導，而不是團體一起玩，這樣才能避免寵物之間產生護食引起衝突，從細節可見其用心。飼主好評不斷：「環境乾淨沒有異味，看得出來非常用心維護」、「環境溫馨舒適，狗狗都很安心住在這邊」、「對狗勾非常親切有耐心，並且認真觀察每隻狗狗狀況」、「非常細心體貼的寵物旅館，很放心把家裡寶貝交給她們」、「保姆非常細心，住宿過很多次，從來沒有失望過」。', '台北市中山區長安東路二段195號1樓', 25.04836000, 121.54326350, 'HT0000041.jpg,HT0000042.jpg,HT0000043.jpg', 323, 534, 725, 1, 1, 1, 1, '2022-04-19 18:00:45', 1),
(5, 1, '狗窩窩愛犬旅社', '希望所有毛小孩來到狗窩窩愛犬旅社能可以像「在家」一般，這是狗窩窩的理念，主要提供美容、住宿、安親等服務，並採不關籠的寄宿方式，讓每個毛孩都有自己的小房間可以睡覺，且保姆也都是經驗豐富的狗奴才，飼主再也不怕狗狗寄宿受委屈！推薦理由：「服務很貼心，每次預約都有配合我們的需求，值得推薦的店家」、「挺好的，狗狗去安親有時他們都會幫狗狗拍照片」、「保姆回訊息都很快， 24  小時監視器，都看的到，也都會回報狗狗的狀況」、「每次我們家狗狗去了都很開心」、「裡面小姐都很客氣而已很有耐心」。', '台北市松山區民生東路五段137巷2-5號', 25.05926260, 121.56175090, 'HT0000051.jpg,HT0000052.jpg,HT0000053.jpg', 342, 551, 690, 1, 0, 0, 1, '2024-09-04 04:07:55', 1),
(6, 1, '好時光寵物旅館', '鄰近內湖四期重劃住宅區的好時光寵物旅館，會依照毛小孩的體型、個性分區照顧，每天還有帶去公園散步、放風的戶外活動時間，甚至連睡覺都是一隻一間獨立空間，讓毛小孩休息不會互相影響。另外，寵物住宿也都備有攝影機，讓飼主可遠端連線觀看！飼主紛紛表示：「對人、寵物都很親切，也會定時回報狀況」、「讓人放心的專業店家、保姆」、「保姆超級貼心，定時回報寵物的狀況，還會陪玩拍照錄影片」、「難得碰到這麽細心的寵物旅館，把毛小孩照顧得很好」、「愛犬住了都不想回家了」。', '台北市內湖區民權東路六段170號1F', 25.06830650, 121.59159340, 'HT0000061.jpg,HT0000062.jpg,HT0000062.jpg', 369, 541, 624, 1, 0, 1, 1, '2022-05-11 02:25:41', 1),
(7, 1, 'D&Y 寵物美容時尚旅店', 'D&Y不僅提供寵物旅館服務，還有協助狗狗中途，尤其在旅館住宿方面，老闆堅持提供毛小孩24小時專業照顧，確保狗狗身旁有寵物保姆，而且會隨時記錄、主動告知飼主毛小孩狀況，飼主也能透過手機視訊查看自己寶貝的現況，環境相當令人安心。狗奴們激推：「我家狗狗超愛這裡的」、「空間舒適，保姆姐姐們都超有耐心又細心」、「每次都很期待保姆分享狗狗在那邊的照片」、「找不到比這裡更讓我們放心的旅館了」、「寶貝交給D&Y 我們很放心」、「非常用心照顧狗狗，住宿期間常傳狗狗狀況」。', '台北市中山區中山北路三段55巷22號', 25.06786070, 121.52389360, 'HT0000071.jpg,HT0000072.jpg,HT0000073.jpg', 342, 526, 740, 1, 1, 0, 1, '2022-07-10 15:43:39', 1),
(8, 1, 'FamilyDog-宜家宜犬', '宜家宜犬有提供安親、住宿、才藝訓練、居家照護、生日派對等服務，並引進韓國寵物美容，不少明星寵物也都曾在這裡住宿過，主打「專人照顧毛孩」，且還能讓狗狗學習社會化，也有協助羅志祥母親照顧救援回來的狗狗，是許多毛小孩的第二個家。狗狗飼主都推薦：「待人親切，狗狗顧得很好」、「看到狗狗每次來都頭也不回的跑進去，就知道來這裡有多開心」、「環境乾淨明亮，照顧狗狗也很細心」、「老闆對狗狗的照顧是發自內心的愛」、「在宜家可以享受陪伴照護、學習社會化，一舉數得」。', '台北市松山區八德路四段259號', 25.04907940, 121.56527600, 'HT0000081.jpg,HT0000082.jpg,HT0000083.jpg', 376, 545, 748, 1, 1, 0, 1, '2022-04-24 04:34:37', 1),
(9, 1, 'Happy愛犬屋', '位於大安捷運站附近的Happy愛犬屋，沒來過的狗狗都須先安親一次，進而讓訓練師評估狗狗狀態是否合適半開放式的居住空間，並強調每日都會去公園遛狗陪玩，依照每一隻毛孩的個性安排適當社交，更厲害是還會把基礎服從，社會化及減敏訓練融入寵物照護， 讓毛孩住宿兼學習！奴才都愛送主子到這寄宿：「台北市狗狗安親住宿最佳體驗」、「老闆娘很親切，也隨時傳圖片讓我們知道我家狗狗入住的很開心」、「孩子們能在住宿的地方開懷笑，都要感謝愛犬屋的照顧」、「毛寶貝每回入住都是一股勁地搖尾巴，我開心也放心」。', '台北市大安區復興南路一段321號6樓', 25.03404830, 121.54385100, 'HT0000091.jpg,HT0000092.jpg,HT0000092.jpg', 333, 561, 747, 0, 1, 1, 1, '2022-05-03 09:44:15', 1),
(10, 1, '就甘心Ponpon寵物旅館', '提供寬敞的活動空間和舒適的住宿設施，讓狗狗們在這裡度過愉快的時光。我們的專業團隊全天候照顧，確保您的毛孩得到最好的待遇。「這裡的服務真的很棒，狗狗每天都很開心」、「有專業的保姆全天照顧，讓我很放心」、「即時影像功能讓我能隨時看到毛孩的狀況，安心不少」、「環境非常適合狗狗，真的是毛孩的天堂」。', '台北市中山區新生北路二段60巷16號4樓', 25.05566880, 121.52680320, 'HT0000101.jpg,HT0000102.jpg,HT0000103.jpg', 345, 550, 658, 1, 1, 0, 0, '2022-03-30 07:52:46', 1),
(11, 4, '柴町寵物旅舍', '擁有豪華的住宿設施和貼心的服務，為狗狗們提供一個舒適、安全的居所。我們的專業團隊24小時照顧，確保每隻狗狗都能得到最好的待遇。「這裡的環境非常優美，狗狗可以盡情玩耍」、「員工們都很有愛心，讓我非常放心」、「看到狗狗在這裡玩得那麼開心，我也很安心」、「每次來這裡，狗狗都不想回家」。', '桃園市桃園區文中路10號', 24.99610300, 121.29479900, 'HT0000111.jpg,HT0000112.jpg,HT0000113.jpg', 325, 553, 733, 1, 1, 1, 0, '2022-05-04 17:54:30', 1),
(12, 1, '狗狗日常寵物旅館', '提供溫馨的居住環境，配備先進的設施和專業的照顧團隊，讓您的狗狗享受最優質的住宿體驗。「旅舍環境乾淨整潔，狗狗在這裡玩得很開心」、「保姆非常細心，讓我很放心」、「有即時影像功能，隨時都能看到毛孩的狀況，安心不少」、「這裡的服務非常周到，真的很棒」。', '台北市文山區羅斯福路六段85號', 24.99858240, 121.54052830, 'HT0000121.jpg,HT0000122.jpg,HT0000123.jpg', 365, 578, 757, 1, 1, 1, 1, '2024-08-29 15:02:52', 0),
(13, 2, 'Fun Pet Resort', '位於板橋區的Fun Pet Resort，致力於為您的毛小孩提供如家一般的溫馨環境。我們的專業團隊確保每位客人都能享受到貼心的照顧和豐富的活動，讓寵物在這裡度過愉快的時光。旅館設施先進，讓寵物們可以盡情玩耍與放鬆，是許多飼主的首選。', '新北市板橋區中山路二段331號', 25.01892860, 121.47924240, 'HT0000131.jpg,HT0000132.jpg,HT0000133.jpg', 355, 540, 780, 0, 1, 1, 0, '2024-08-29 20:29:31', 0),
(14, 2, '狗狗村', '狗狗村位於新莊區，擁有寬敞的活動空間和專業的照護服務，為您的毛孩子提供一個安全且舒適的居住環境。這裡的工作人員非常細心，會根據每隻狗狗的需求提供個性化服務，讓寵物和飼主都感到滿意和安心。「這裡的服務真的很棒，狗狗每天都很開心」、「有專業的保姆全天照顧，讓我很放心」、「即時影像功能讓我能隨時看到毛孩的狀況，安心不少」、「環境非常適合狗狗，真的是毛孩的天堂」。', '新北市新莊區中正路432號', 25.03381130, 121.44056880, 'HT0000141.jpg,HT0000142.jpg,HT0000143.jpg', 338, 572, 658, 0, 1, 1, 1, '2022-05-05 08:23:15', 1),
(15, 2, '毛小孩之家', '毛小孩之家位於三重區，是一個專門為寵物設計的舒適空間。這裡不僅有貼心的服務，還有多樣的娛樂設施，讓您的毛孩子可以在旅途中放鬆身心。許多顧客稱讚這裡的環境乾淨，服務周到，是毛小孩度假時的理想選擇。「這裡的環境很棒，狗狗和我都很喜歡」、「工作人員非常有愛心，狗狗在這裡過得很開心」、「有即時影像功能，讓我可以隨時看到狗狗的狀況，很安心」、「這裡的服務非常周到，真的很棒」。', '新北市三重區重新路五段543號', 25.04625120, 121.47076790, 'HT0000151.jpg,HT0000152.jpg,HT0000153.jpg', 373, 539, 768, 1, 1, 1, 1, '2022-02-19 21:53:32', 1),
(16, 2, 'Pet Stay', 'Pet Stay坐落於永和區，以其現代化的設施和貼心的服務著稱。這裡提供24小時全天候的照顧，確保您的寵物在離家期間得到最好的關愛。無論是短期還是長期住宿，Pet Stay都能滿足不同飼主的需求，是寵物們的第二個家。', '新北市永和區中山路一段275號', 25.00710020, 121.50723420, 'HT0000161.jpg,HT0000162.jpg,HT0000163.jpg', 341, 549, 662, 1, 1, 0, 0, '2022-04-07 18:39:30', 1),
(17, 2, '寵物天堂', '位於汐止區的寵物天堂是一家深受飼主信賴的寵物旅館。這裡的設施完備，環境乾淨，提供全方位的照顧服務。飼主們對這裡的專業服務和溫暖的氛圍讚不絕口，讓寵物們在這裡度過一段快樂的時光。這裡的服務真的很棒，狗狗每天都很開心」、「有專業的保姆全天照顧，讓我很放心」、「即時影像功能讓我能隨時看到毛孩的狀況，安心不少」、「環境非常適合狗狗，真的是毛孩的天堂」。', '新北市汐止區大同路一段268號', 25.05726900, 121.63387860, 'HT0000171.jpg,HT0000172.jpg,HT0000173.jpg', 320, 574, 652, 1, 0, 1, 1, '2022-02-09 12:39:15', 1),
(18, 2, '幸福寵物之家', '幸福寵物之家位於永和區，專為愛寵們打造了一個溫馨的居住環境。旅館注重每個細節，提供個性化的照護服務，讓每位毛孩子都能感受到家的溫暖。這裡的員工專業且富有愛心，深受顧客的信賴與喜愛。狗奴們激推：「我家狗狗超愛這裡的」、「空間舒適，保姆姐姐們都超有耐心又細心」、「每次都很期待保姆分享狗狗在那邊的照片」、「找不到比這裡更讓我們放心的旅館了」、「寶貝交給D&Y 我們很放心」、「非常用心照顧狗狗，住宿期間常傳狗狗狀況」。', '新北市永和區竹林路168號', 25.01010800, 121.52023910, 'HT0000181.jpg,HT0000182.jpg,HT0000183.jpg', 322, 524, 639, 1, 0, 0, 1, '2024-08-29 20:29:21', 1),
(19, 2, '汪星人渡假村', '汪星人渡假村位於板橋區，是狗狗們的天堂。這裡設施齊全，提供多樣的娛樂活動和舒適的住宿環境，讓每隻狗狗都能享受一段愉快的假期。許多飼主表示，汪星人渡假村是他們放安心愛寵物的首選地點。', '新北市板橋區文化路二段12號', 25.02414970, 121.46893080, 'HT0000191.jpg,HT0000192.jpg,HT0000193.jpg', 324, 527, 712, 1, 1, 0, 1, '2022-04-01 19:50:04', 1),
(20, 4, '花ni萌 Pet House寵物旅館', '柴町寵物旅舍提供寬敞舒適的居住環境，專為狗狗設計，讓牠們享受家一般的溫暖。我們有專業的保姆24小時照顧，每天帶狗狗們散步，確保牠們得到充分的運動和關愛。客戶評價：「旅舍環境乾淨整潔，狗狗在這裡玩得很開心」、「保姆非常細心，讓我很放心」、「有即時影像功能，隨時都能看到毛孩的狀況，安心不少」。', '桃園市八德區桃園市八德區永福西街32巷3號', 24.99610300, 121.29479900, 'HT0000201.jpg,HT0000202.jpg,HT0000203.jpg', 369, 563, 716, 0, 1, 1, 1, '2024-08-29 15:03:09', 0),
(21, 4, '花居寵物生活別館', '花居寵物生活別館融合自然景觀與現代設施，為狗狗提供一個放鬆的度假勝地。每日的戶外活動和專業的照顧服務讓狗狗們充滿活力和快樂。「這裡的環境非常優美，狗狗可以盡情玩耍」、「員工們都很有愛心，讓我非常放心」、「看到狗狗在這裡玩得那麼開心，我也很安心」、「每次來這裡，狗狗都不想回家」。', '桃園市桃園區中正三街389號', 25.00283670, 121.29895450, 'HT0000211.jpg,HT0000212.jpg,HT0000213.jpg', 364, 522, 747, 1, 1, 1, 1, '2022-04-15 06:19:13', 1),
(22, 4, '快樂尾巴寵物旅館', '快樂尾巴寵物旅館致力於讓每一隻狗狗都感受到快樂與愛。我們提供不關籠的自由空間和全天候的專業照顧，讓您的毛孩在這裡享受一個愉快的假期。「這裡的服務真的很棒，狗狗每天都很開心」、「有專業的保姆全天照顧，讓我很放心」、「即時影像功能讓我能隨時看到毛孩的狀況，安心不少」、「環境非常適合狗狗，真的是毛孩的天堂」。', '桃園市桃園區中正路348號', 24.99843080, 121.30883890, 'HT0000221.jpg,HT0000222.jpg,HT0000223.jpg', 366, 575, 750, 1, 1, 1, 1, '2022-03-23 15:03:16', 1),
