INSERT INTO `product` (`id`, `name`, `brand`, `cate_1`, `cate_2`, `is_near_expired`, `is_refurbished`, `description`) VALUES
(1, 'DailyCat 犬用鮮肉罐頭 (多種口味)', 'ZiwiPeak 巔峰', '罐頭', '主食罐頭', 0, -1, '● 91%超高含肉量● 嚴選100%紐西蘭自然放牧鹿隻● 無穀、無膠、無人工添加物● 低磷、低碳水化合物● 罐頭不含有毒雙酚Ａ● 營養標示項目符合AAFCO各年齡層狗狗營養標準'),
(2, 'ECO-LIFE 天然防蚤驅蟲系列', '舒活', '外出', '外出道具', -1, 0, '● 嚴選天然成分 獨家頸圈設計有效幫助防蚤驅蟲● 完全防水 可直接配戴於寵物身上● 可預防蜱蟲、跳蚤和蚊子叮咬● 100%天然成分● 無毒無藥性● 全方位保護寵物健康'),
(3, '前後可背托特寵物雙肩包', 'HiDREAM', '外出', '外出包', -1, 0, '● 人體工學設計 護脊三角受力● 全新設計背帶 更符合人體舒適度● 頂部雙重開口 防止愛寵脫逃'),
(4, '寵物自背包 - 夾心餅乾', 'PURLAB', '外出', '外出道具', -1, 0, '● 人寵共用親子款● 強力魔鬼氈 自己的東西自己背● 多種用法 告別閒置● 優質五金 使用感UP'),
(5, 'VD-5 Vet Life 犬用肝臟配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●使用玉米筋質粉及水解魚肉做為高品質、好消化、易吸收的蛋白質來源●低銅配方限制銅的攝取●富含omega-3不飽和脂肪酸及充足多元的維他命複合物以保護肝臟●本品為肝臟病犬專用之處方食品，需在獸醫師評估下使用。可作為主食。'),
(6, '單一蛋白鮮肉乾糧 低敏犬 - 沙丁魚 X 鱈魚', '安柏希雅', '飼料', '一般乾糧', 0, -1, '安柏希雅新鮮沙丁魚和鱈魚配方是一款特別設計的寵物食品，結合易消化的新鮮沙丁魚肉和優質的鱈魚蛋白。添加橄欖油以及希臘地中海水果和香草，打造了低過敏性、地中海健康飲食、無穀物的配方飼料，同時富含抗氧化食材，適合所有犬種。精心挑選的人類食用級成分，採用小型顆粒飼料，安柏希雅不僅提供了全面的營養，還為帶來美味的口感和豐富的風味，讓您的狗狗保持健康和快樂。'),
(7, '犬用90%鮮肉主食餐包 (兩種口味)', '汪喵星球', '罐頭', '鮮食餐包', 0, -1, '• 90%鮮肉ｘ四色蔬果，天然機能食補• 鮮食免加熱，開封即食超方便！• 符合 AAFCO／NRC 主食營養標準• 每入 150g'),
(8, '無穀區域頂級食材主食糧 - 多種魚 X 薰衣草', 'ACANA愛肯拿', '飼料', '無榖乾糧', 0, -1, '對飲食較敏感的狗狗，研製單一肉類蛋白來源的飼糧，利用專利WholePrey™比例，提供給毛孩天然營養，減少狗狗對合成維生素及胺基酸的造成的敏感●傳承加拿大豐饒的農、漁業文化，運用當地的新鮮蔬果、亞伯達農場自由放養的雞肉、火雞肉、巢蛋及北溫哥華群島捕撈的野生鼓眼魚、鱒魚，製作出高達70%高肉含量的營養配方，多元且豐富肉類蛋白，低溫烘焙完整保留鮮肉及蔬果的香氣及營養，一開袋就能聞到濃厚肉香，大大提升適口性●每公斤有高達700mg的葡萄糖胺及1500mg的軟骨素，可從飲食中保護、強化關節●除了蘋果、梨子等多種新鮮蔬果提供完整均衡的營養，更添加冬南瓜及南瓜提供可溶性纖維，大大提升腸胃消化機能；添加蜀葵根及完整蔓越莓、藍莓，幫助維持泌尿道健康●薑黃、玫瑰果、菊苣根、牛蒡…等多項高營養價值植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害●水飛薊、薰衣草、苜宿等有機海洋蔬菜與草本植物，幫助促進新陳代謝。'),
(9, '露營胸背套裝 (含牽繩 & 拾便袋)', 'FurryTail', '外出', '外出道具', -1, 0, '● 露營胸背套裝含牽繩 & 拾便袋 一組搞定● 減壓胸背帶 極致呵護爱寵● 防水衝鋒衣面料 一抖就乾淨● 自帶反光條 夜晚散步更安心'),
(10, 'GD-2 GD-3 GD-5 GD-6 GD-7 GD-9 天然頂級無穀系列', 'Farmina 法米納', '飼料', '無榖乾糧', 0, -1, '●WDJ多年推薦、DFA五星級評等●70%新鮮肉塊成份●以義大利放山土雞新鮮肉塊製成●以紐西蘭羊肉新鮮肉塊製成●以義大利托斯卡尼產的放牧野豬新鮮肉塊製成●完全不添加肉粉，不使用人工添加物●選用各式新鮮蔬果搭配，其中蘋果富含多種維生素以及膳食纖維●中大型顆粒可幫助摩擦牙結石，為犬隻絕佳的保健天然糧適用對象：成犬'),
(11, '寵物推車專用配件 - 手把保護套 (多色)', 'FikaGO', '外出', '推車配件', -1, 0, '● 防污耐髒易清潔● 避免細菌附著 保持衛生● 魔鬼粘設計佳 安裝方便● 潛水衣布材質 具有彈性● 延長推車使用年限'),
(12, '即期品專區 - 毛孩蒸鮮常溫鮮食 (多種口味)', '飼糧倉', '罐頭', '鮮食餐包', 0, -1, '●高壓高溫滅菌 放心食用●真空包裝/拆封即食●全齡汪喵皆可食用/黑鮪魚丁丁●超絕新鮮東港海鮮風味搭配●嚴選鮪魚低溫烘乾製作，滋味鮮美●鮪魚含高蛋白質之外，含有豐富的不飽和脂肪酸及鐵、鉀等礦物質/厚切鮪魚排●超絕新鮮東港海鮮風味搭配●嚴選鮪魚低溫烘乾製作，滋味鮮美●鮪魚含高蛋白質之外，含有豐富的不飽和脂肪酸及鐵、鉀等礦物質/爆漿牛肉丸●牛肉－天然補鐵、優質蛋白質●膠原蛋白－保護關節、保持皮膚彈性且可促進傷口癒合●可以當零食餵食，也可以與主食混在一起，美味更出眾！/奇亞籽雞肉丸●選用認證本土低脂雞胸肉品，低脂肪高蛋白●奇亞籽－豐富的ω-3脂肪酸、Omega-3和維生素B●膠原蛋白－保護關節、保持皮膚彈性且可促進傷口癒合●堅持原味，保有天然食材水分/南瓜燒雞●選用認證本土低脂雞胸肉品，低脂肪高蛋白●雞胸肉蒸至軟熟，緊緊地鎖住美味！●南瓜－澱粉，增加飽足感、增加甜味●可以當零食餵食，也可以撕成雞絲與主食混在一起，美味更出眾！/原味鮮嫩雞柳●選用認證本土低脂雞胸肉品，低脂肪高蛋白●雞胸肉蒸至軟熟，緊緊地鎖住美味！●可以當零食餵食，也可以撕成雞絲與主食混在一起，美味更出眾！'),
(13, '佛跳牆澎湃美味四喜罐 (多種口味)', '怪獸部落', '罐頭', '副食罐頭', 0, -1, '● 史上最多料的罐罐● 四種好料總匯，多層美味一次滿足● 無膠無穀無香料，好吃也不怕挑嘴'),
(14, '潔牙成犬無穀配方 放養雞肉+新鮮蔬果', 'ACANA愛肯拿', '飼料', '無榖乾糧', 0, -1, 'ACANA雞肉及褐色馬鈴薯富含豐富的放養雞肉，蛋及馬鈴薯，溫哥華島撈補的野生比目魚及Okanagan谷所生產的蔬果—為了有最佳營養和頂尖美味，每日搶鮮運送且不含防腐劑。傳承加拿大豐饒的農、漁業文化，愛肯拿運用當地的新鮮食材，為全年齡層狗狗製作的全方位生物學性飼糧。●使用亞伯達農場自由放養的雞肉及巢蛋、北溫哥華群島捕撈的野生鯡魚、比目魚，低溫烘焙鮮肉，完整保留肉類及蔬果的香氣與營養，一開袋就能聞到濃厚肉香，大大提升適口性●特殊設計飼糧大小及脆度，咀嚼進食時能幫助磨牙，口腔保健●從豐富的魚類中攝取Omega-3及Omega-6，不但能保養心血管，對於心臟、免疫系統、大腦發育也非常有助益●從豐富的野生魚類中攝取的優質DHA及EPA，從飲食中保健腦部及眼部●每公斤有高達1200mg的葡萄糖胺及900mg的軟骨素，可從飲食中保護、強化關節。●從各種新鮮蔬果幫助提供完整均衡的營養 ，添加東南瓜及南瓜提供可溶性纖維外，更添加腸球菌，大大提升腸胃消化機能，蜀葵根及完整蔓越莓添加，幫助維持泌尿道健康●薑黃、菊苣根、牛蒡根…等多項高營養價值草本植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害，薰衣草幫助抗菌、降脂'),
(15, 'SUBZERO 黑鑽頂級無穀凍乾糧 - 全齡犬 鴨肉X鱒魚X羊肉', '紐崔斯', '飼料', '無榖凍乾', 0, -1, '●頂級高蛋白無穀糧+凍乾營養鮮肉粒●優質鮮肉+鮮魚蛋白質●低升醣碳水化合物●北美盛產蔬菜水果●椰子油&營養豐富的草本植物'),
(16, 'VD-13 Vet Life 犬用極低敏(水解蛋白)配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●使用極小分子(≦6000dalton)的水解魚肉蛋白和精選的米澱粉製成，除了更好消化吸收外也使用低致敏性食材，不易造成食物過敏●選用富含omega-3的魚油大幅提高水解蛋白飼料的適口性，並添加適量鋅協助皮膚保健，維持皮毛良好狀態。本品為皮膚或腸胃道敏感之犬專用處方食品，由高含量LA以及EPA、DHA所組成，具有適量必須營養素。需在獸醫師評估下使用，可作為主食。'),
