(18, 'VD-12 Vet Life 犬用血糖管理配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '使用獨家斯佩爾特小麥和燕麥製成低升糖指數的配方，降低碳水化合物的比例，選用高品質蛋白質、左旋肉鹼及牛磺酸幫助肌肉發展，增加膳食纖維增添飽足感，同時降低脂肪含量減少熱量攝取。本品為糖尿病犬專用之處方食品，需在獸醫師評估下使用，可作為主食。'),
(19, '96% 鮮肉犬糧 - 牛肉', 'ZiwiPeak 巔峰', '飼料', '一般乾糧', 0, -1, '●96%超高含肉量●採用雙階段模擬自然風乾技術●嚴選100%紐西蘭天然放牧草飼牛●富含不飽和脂肪酸、天然維生素B~1 B~2 E●高蛋白質及低飽和脂肪含量●適合活動力高的狗寶貝'),
