(48, '6合1專利化毛粉', '毛孩時代', '保健', '化毛', 0, -1, '● 含天然分解毛髮、促進腸胃運動成分● 含天然油脂，加速毛髮排出● 不含礦物油、防腐劑● 不含增味劑'),
