(50, 'Brightkins寵物益智藏食盤 - 杯子蛋糕', 'Brightkins', '玩具', '益智玩具', -1, 0, '在杯子蛋糕中找美食！愛寵在解有趣益智玩具時,總能享受擊退無聊、啟發智力的樂趣！●Brightkins 美國益智玩具●使用不含雙酚A的安心塑料製成●為寵物們帶來生動的學習體驗●增強智力刺激 促進活躍遊戲●激發寵物的好奇心 讓整個家庭都參與其中'),
(51, 'TAURINE 牛磺酸', '汪喵星球', '保健', '視力保健', 0, -1, '● 自製生鮮食的毛孩家庭、以飼料為主食的犬貓建議補充● 市售90%以上的牛磺酸原料來源不明、或來自中國，汪喵選擇來自日本 KASANO 有檢驗報告的純牛磺酸，搭配 10% 的膳食纖維打造！'),
(52, '紐西蘭無穀成犬糧 - 放牧草飼羊', '本牧', '飼料', '無榖乾糧', 0, -1, '●非基因改造成分●無穀低敏感配方●100%紐西蘭肉源●無抗生素、無生長促進劑、無人工香料或色素●人道自由放牧'),
(53, 'BITE ME藏食發聲玩具 - 哈哈蘇打', 'BITE ME', '玩具', '發聲玩具', -1, 0, '清爽沁涼的哈密瓜汽水,搭配香草冰淇淋的絕妙組合！香草冰淇淋和哈密瓜汽水杯,都有各放入一個啾啾聲,讓喜愛啾啾聲的寶貝,不管玩哪一個,都有滿滿的聲響香草冰淇淋下面,完美的藏入好吃的零食,開始一場夏季點心嗅聞吧！'),
(54, '寵立善保健品 - UC-II 全方位關節保養粉', '自然食', '保健', '關節保健', 0, -1, '●重量級採用美國專利 UC-II非變性二型膠原蛋白，有效保護關節活動力。●紐西蘭綠唇貽貝，含豐富omega-3等營養素，給予關節天然又有效的營養來源。●歐洲專業大藥廠食品級天然萃取玻尿酸，首支通過美國 FDA-GRAS安全認證。●日本專利葡萄糖胺，經兩段式純化技術，純度高達99%！'),
(55, '功能性全齡犬配方糧 - 鮭魚 X 糙米 (腸胃保健)', '柏萊富', '飼料', '功能配方', 0, -1, '●低溫慢火烹調，降低便量與便臭●優質天然鮭魚肉，高適口性滿足愛犬挑剔的味蕾●精選食材，幫助保護弱敏肌膚及敏感腸胃●高含量亞麻油酸，幫助護膚亮毛●豐富蔬果精華天然抗氧化劑，維持抵抗力●葡萄糖胺及軟骨素，幫助維護關節健康'),
(56, 'FAD Plus汪汪耐咬發聲玩具 - 農場粉小豬', 'FAD Plus', '玩具', '發聲玩具', -1, 0, '來自日本的FAD+無毒安全玩具,每個玩具都經過歐盟EN71 part 3 玩具安全認證,通過無重金屬殘留測試,讓寶貝玩得更安心！FAD+春夏超可愛農場系列粉小豬是低音哞哞聲寶貝可以享受不同的聽覺刺激,挑選最喜歡的農場動物唷'),
(57, '新風寵物外出箱', 'pidan', '外出', '外出包', -1, 0, '●全新的外出方式 各有各的輕鬆●箱內設置風扇 獨立新風系統 外出多久都安心●減震設計 路面不平也無妨●圓形視窗和私密箱體 隨時安心看世界●寬敞空間還內置了軟墊 更舒適●內置照明 不同場合都可使用●單向互動窗口 方便安撫又安全●可調節拉桿 輕鬆省力●磨砂觸感簡潔外觀●箱體附Type-C孔充電設計'),
(58, '極鮮無穀全齡配方糧 - 火雞肉 X 扁豆 (活力犬)', '柏萊富', '飼料', '無榖乾糧', 0, -1, '●低溫慢火烹調，降低便量與便臭●高優質全天然火雞肉，營養滿分，維持愛犬活力●100%無穀配方，減少食物過敏機率●高含量亞麻油酸，幫助護膚亮毛●添加天然椰子油，維持抵抗力關節健康●苜蓿富含胡蘿蔔素，保護眼睛●多種益生菌與果寡糖，幫助保健腸道'),
(59, 'BITE ME藏食發聲玩具 - 復刻卡帶', 'BITE ME', '玩具', '發聲玩具', -1, 0, '●藏食功能與可愛外型兼具的玩具！●啾啾聲誘發寶貝好奇心●響紙沙沙聲吸引寶貝注意力●有五個可藏食的口袋 滿足喜歡嗅聞的毛孩'),
(60, '寵物泡泡箱 (兩色)', '未卡', '外出', '外出包', -1, 0, '● 出行方便● 透明外觀可觀察寵物情況● 空間容納大● 多方位透氣孔 保證空氣流通● 抽拉輕鬆● 輪軸360度轉動不受拘束'),
(61, '無穀配方犬用乾糧 - 雞肉 X 火雞肉', 'Nurture PRO 天然密碼', '飼料', '無榖乾糧', 0, -1, '●78%動物性蛋白質●0%穀物、麩質、副產品●低溫慢火烘焙●10種天然超級食材●益生菌及益菌生加強保護●添加椰子油、鮭魚油及月見草籽油'),
(62, 'BITE ME造型發聲玩具 - Party', 'BITE ME', '玩具', '發聲玩具', -1, 0, '開party囉！！開趴必備的佈置道具,色彩鮮豔的氣球狗,是不是超級可愛的~適合咬著的尺寸,搭配上啾啾聲,絕對是寶貝愛不釋手的必備玩具。派對中怎麼能少了party帽,三種顏色一起分享給其他朋友們♥翻開邀請卡還有許多嗅聞口袋可以藏食,不只可以當造型拍照,還可以當作嗅聞玩具,多種玩法,絕對是派對中必備的玩具！'),
(63, 'Eggy 小宅包', 'HOUSMALL', '外出', '外出包', -1, 0, '●直接水洗不怕髒汙●可承受六公斤愛寵●安全勾繩設計●底部深碗型設計 出外也有安全感●內置置物袋'),
(64, '鮮雞幼犬 無穀配方', 'Orijen 歐睿健', '飼料', '一般乾糧', 0, -1, '●Orijen 含40%豐富蛋白質，19%低升醣的碳水化合物，根據成貓幼貓的生理需求，完整滋養您的愛貓。●ORIJEN裡2/3的肉是鮮肉（冷藏、不加防腐劑）或生鮮（急速冷凍、不加防腐劑），是其他品牌的狗食品無法比擬的。●1/3的肉為新鮮雞肉、火雞肉和魚類，以90度低溫進行溫和脫水，供給鮮肉無法單獨提供的豐富蛋白質。●滿滿營養的完整獵食比例鮮肉、內臟和軟骨，加上完整的魚類和雞蛋，完美滿足所有幼犬的營養需求。●加入冷凍乾燥雞肝和火雞肝，大幅提升適口性，ORIJEN美味無比，就連最挑食的狗都無法拒絕。'),
(65, 'LINSLINS聖誕系列犬用咬繩', 'LINSLINS', '玩具', '啃咬玩具', -1, 0, '●磨牙潔齒 助力口腔清潔 ●增加運動量 避免居家肥胖 ●軟硬適中不傷牙齒 ●日常清潔濕布擦拭即可'),
(66, '寵物車載中控窩包 - 上開款 (多色)', 'mao&kou', '外出', '外出包', -1, 0, '● 可居家、車載、外出● 可單肩、手提、斜背● 可拆洗獨立內膽設計● 雙儲物口袋 可放配件● 雙牽引扣 長度可調整'),
(67, 'T23 T25 T26 無穀全能系列 火雞+雞肉 鮭魚+鱒魚 羊肉', '紐頓', '飼料', '無榖乾糧', 0, -1, '【T23火雞+雞肉】●多元而富含營養配方的食譜，從裡到外改善你寵物的健康●添加低升糖的扁豆、青豆和鷹嘴豆作為健康的碳水化合物和優質蛋白質的來源●結合石榴和覆盆子，豐富強大的抗氧化食材，增加自然抵抗力●火雞肉含色氨酸(一種必須胺基酸)，和洋甘菊等都是有助舒緩特點T25鮭魚+鱒魚●紐頓草本平衡的最佳組合●不含穀類與兼具低升醣平衡的天然食材調配●21天然草本蔬果食材的最佳搭配組合，給予寵物最完整的需求●使用現在眾所皆知的(超級食物之稱的食材)除了營養完整更讓身體健康●最佳動物肉類蛋白，低升醣高纖屬性豆類，高抗氧，高吸收●無添加馬鈴薯及木薯等澱粉●添加天然抗氧化劑食材-藍莓及黑莓，有助於增加自然抵抗力【T26羊肉】●優質蛋白來源，強健肌肉●豐富纖維，幫助消化●促進腸道益菌生長●低升糖食材●好的碳水化合物'),
(68, '全齡犬用主食餐盒 (多種口味)', '優格', '罐頭', '鮮食餐包', 0, -1, '●最豐富的肉肉主食餐盒：雞、牛、羊、鮭魚等新鮮肉品搭配鵪鶉蛋、鮮蔬豐富配料● 健康鮮蔬：提供膳食纖維、維生素等天然營養素● 天然美味：全蛋基底天然美味、健康營養● 100%零榖配方：純天然不含人工香料、色素、防腐劑● 本產品符合AAFCO營養標準'),
(69, '新綠野防水驅蟲頸圈', '法國法典', '外出', '外出道具', -1, 0, '● 天然苦楝(天然驅蟲劑)及薰衣草萃取精華複方● 無添加聚氯乙烯及鄰苯二甲酸酯● 對動物、環境無毒無害● 保護時間長達4個月'),
(70, 'LD-6 LD-8 LD-9 天然低穀系列', 'Farmina 法米納', '飼料', '一般乾糧', 0, -1, '●WDJ多年推薦、DFA五星級評等●使用低升糖成份-斯佩爾特小麥、燕麥●以義大利放山土雞新鮮肉塊製程●以紐西蘭羊肉新鮮肉塊製成●完全不添加肉粉，不使用人工添加物●並選用各式新鮮蔬果搭配，其中藍莓更是擁有多種保健效果，為犬隻絕佳的保健天然糧適用對象：成犬'),
(71, '犬貓無膠鮮肉煲 (多種口味)', '怪獸部落', '罐頭', '副食罐頭', 0, -1, '● 熱銷破百萬罐！犬貓補水神器● 無膠無穀，100% 純肉鮮湯罐● 濃郁高湯＋鮮嫩肉塊● 讓小怪獸大口喝湯吃肉！'),
(72, '寵物推車專用配件 - FLYTTA 汽車座椅保護墊', 'FikaGO', '外出', '推車配件', -1, 0, 'ISOFIX兼容，將後向安全扣連接到車輛ISOFIX系統，前向安全扣連結到座艙扣環，再搭配推車附件揹帶環繞汽車座椅頭枕可加強固定力道'),
(73, '挑嘴幼犬無穀配方 放養雞肉+新鮮蔬果', 'ACANA愛肯拿', '飼料', '無榖乾糧', 0, -1, 'ACANA小型幼犬配方富含豐富的放養雞肉，蛋及馬鈴薯，從溫哥華島撈補的野生比目魚及卑詩省Okanagan谷的蔬果，每日搶鮮運送且不含防腐劑，以達到獨一無二的營養及最佳風味。傳承加拿大豐饒的農、漁業文化，運用當地的新鮮食材，依據各種體型、生長階段的狗狗設計符合生物學性的主食。●使用亞伯達農場自由放養的雞肉及巢蛋、北溫哥華群島捕撈的野生鯡魚、比目魚，低溫烘焙鮮肉，完整保留肉類及蔬果的香氣與營養，一開袋就能聞到濃厚肉香，大大提升適口性，針對幼犬成長所需的高動物蛋白質及營養成份，統統濃縮到幼犬適合的咀嚼大小。●從豐富的魚類中攝取Omega-3及Omega-6，不但能保養心血管，對於心臟、免疫系統、大腦發育也非常有助益。●從豐富的野生魚類中攝取的優質DHA及EPA，從飲食中保健腦部及眼部。●每公斤有高達1400mg的葡萄糖胺及900mg的軟骨素，可從飲食中保護、強化關節。●從各種新鮮蔬果幫助提供完整均衡的營養 ，添加東南瓜及南瓜提供可溶性纖維外，更添加腸球菌，大大提升腸胃消化機能，蜀葵根及完整蔓越莓添加，幫助維持泌尿道健康。●薑黃、菊苣根、牛蒡根…等多項高營養價值草本植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害，薰衣草不僅能抗菌、降脂，更幫助舒緩情緒。'),
(74, '犬用95%鮮肉無膠主食罐 (多種口味)', '汪喵星球', '罐頭', '主食罐頭', 0, -1, '● 95% 鮮肉及內臟＋5% 植物與必需營養素● 嚴選頂級食材、產地溯源● 完全無人工膠類、防腐劑等不良添加物'),
(75, '棉花糖牽引繩 (多色)', 'MAOGOUBLUE', '外出', '外出道具', -1, 0, '● 棉花糖般軟糯Q彈的手感● 雙段式牽引設計● 可移動矽膠束繩環● 萬向旋轉掛鉤'),
(76, '無穀鮮肉乾糧 幼母犬 - 雞肉 X 鮮魚', '安柏希雅', '飼料', '無榖乾糧', 0, -1, '安柏希雅雞肉和鮮魚生長配方是一種經過精心設計的寵糧，結合了易於消化的鮮魚蛋白質和高營養的雞肉蛋白質，同時添加了西蘭花、菠菜、蔓越莓和藍莓等超級食物。此外，它還含有益生元和益生菌，有助於維持消化和免疫系統，以及適量的鈣，有助於狗狗的骨骼發展。這種無穀物的飼料適合所有品種的狗，為他們提供全面均衡的營養，保持健康和活力。'),
(77, '膠原蛋白機能鮮食餐包 (多種口味)', '寵心出發', '罐頭', '鮮食餐包', 0, -1, '●特別添加日本第一大廠膠原蛋白● 胜肽型膠原蛋白更容易吸收● 添加魚油粉● 富含Omega-3，好的油脂可保護毛孩心血管及皮毛，舒緩敏感肌膚● 添加冷壓椰子油● 幫助毛孩更好的吸收營養'),
(78, '寵物外出擠壓水壺 - 背帶款 (多色)', 'MewooFun', '外出', '飲食用品', -1, 0, '● 折疊設計 輕鬆出行● 餵食餵水 一個搞定● 擠壓出水 滴水不漏● 手拎掛繩 攜帶方便'),
(79, '單一蛋白鮮肉乾糧 低敏犬 - 火雞肉', '安柏希雅', '飼料', '一般乾糧', 0, -1, '安柏希雅新鮮火雞肉配方來自火雞肉高品質和低脂肪蛋白質，為您的狗狗提供了優質的營養來源。添加橄欖油以及地中海水果和香草，打造了低過敏性、希臘地中海健康飲食、無穀物的配方飼料，同時富含抗氧化食材，適合所有犬種。精心挑選的人類食用級成分，採用小型顆粒飼料，安柏希雅不僅提供了全面的營養，還為您的狗狗帶來美味的口感和豐富的風味，讓您的狗狗保持健康和快樂。'),
