(98, 'CCN 敏感保健乾糧 - UMN 泌尿保健 小型成犬', '法國皇家', '飼料', '功能配方', 0, -1, '●小型指成大體重10公斤以下●專為泌尿道系統健康設計 精準營養配方●有效幫助尿液稀釋21%●不利結石生成的膀胱環境平衡礦物質●幫助泌尿道健康●小顆粒，大學問 量身訂製的專屬顆粒'),
