(105, '蟲蟲潔牙棒 - 小型犬', 'YORA', '零食', '潔牙骨', 0, -1, '牙菌斑和壞口氣都走開！YORA蟲蟲潔牙棒獨特造型的結構以及天然活性成分，幫助減少牙菌斑和牙垢形成的機率，其中富含生物可利用的鈣質用以幫助牙齒強健，蘋果和薄荷用以幫助口氣清新，以及大量健康蟲蟲，是一種超級食物蛋白質。●適合小型/中型犬●特殊纖維幫助牙垢去除●六偏磷酸鈉幫助牙垢控制●低過敏性●4個月以上的狗狗使用'),
(106, '眼睛營養保健', 'Broadreach NATURE+', '保健', '視力保健', 0, -1, '● 科學實證 獸醫研發配方● 包含VIS-EASE©天然藥草成分組成的獨特混合物● 英國製造針對眼睛健康所設計的營養保健品，由獸醫專家研發，並經過科學驗證支持。狗狗和貓咪常見眼睛乾澀、有發炎狀況、白內障、眼睛退化病變等問題，需要及早呵護與營養保健。護眼漿果是一種獨特、天然、生物可利用的植物藥草配方，提供玉米黃質、紫檀芪、多酚花青素及葉黃素等支持。這些植物性成分已經被證實可以支持視網膜及角膜的健康，進而幫助犬貓維持支持正常視覺功能。'),
