(146, '犬用 紐西蘭風乾主食糧 - 雞肉', '洛特夫', '飼料', '一般乾糧', 0, -1, '●紐西蘭風乾主食糧，品質有保證●精選優質雞肉，提供狗狗所需的蛋白質●全齡犬適用，滿足各年齡段的營養需求●風乾製程，保留食材的營養價值●454g包裝方便攜帶，無論在家或外出都能享受美味●讓您的狗狗品嚐紐西蘭風味，健康又美味的飼料選擇'),
(147, 'VD-8 Vet Life 犬用草酸鈣結石配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●添加檸檬酸鉀幫助鹼化尿液pH值，較低的鈣離子與維生素D~3降低蛋白質與普林含量●本品為泌尿道草酸鈣結石犬專用之處方食品，限制蛋白質含量。需在獸醫師評估下使用，可作為主食。'),
(148, '寵物拾便袋包 - 夾心餅乾', 'PURLAB', '外出', '外出道具', -1, 0, '● 小餅乾大容量 可存2捲● 底部1.5cm 洞口 方便隨時抽取● 優質登山扣 百搭掛法 方便出行'),
(149, 'SHN 健康體型乾糧 – MNINA+8 小型室內熟齡犬8+歲', '法國皇家', '飼料', '一般乾糧', 0, -1, '●活力支持●富含EPA-DHA及抗氧化物複合配方●維護腸道健康配方●减少糞便臭味●幫助進食●高水合性顆粒設計●維護牙齦健康●小顆粒 大學問●量身訂製的專屬顆粒'),
(150, 'VD-15 Vet Life 犬用低敏配方(雞蛋+白米)', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●使用雞蛋以及白米做為單一動物性蛋白和碳水化合物的來源，也使用低致敏性食材，不易造成食物過敏●添加omega-3的魚油大幅提高水解蛋白飼料的適口性以及協助皮膚保健●本品為皮膚或腸胃道敏感之犬專用處方食品，由高含量LA以及EPA、DHA所組成，具有適量必須營養素。需在獸醫師評估下使用，可作為主食。'),
(151, '即期品專區 - 原肉零食 (多種口味)', '汪喵星球', '零食', '凍乾拌料', 1, -1, '汪喵凍乾小零嘴可常溫保存，因採用目前最好的「冷凍乾燥技術製作」除食材本身營養無其他添加物，給毛孩自然無負擔的寵愛。'),
(152, '加購 天然無穀糧系列 (多種口味)', 'Farmina 法米納', '飼料', '無榖乾糧', 0, -1, '●WDJ多年推薦、DFA五星級評等●70%新鮮肉塊成份●以義大利放山土雞新鮮肉塊製成●以紐西蘭羊肉新鮮肉塊製成●以義大利托斯卡尼產的放牧野豬新鮮肉塊製成●完全不添加肉粉，不使用人工添加物●選用各式新鮮蔬果搭配，其中蘋果富含多種維生素以及膳食纖維●中大型顆粒可幫助摩擦牙結石，為犬隻絕佳的保健天然糧適用對象：成犬'),
(153, '96% 鮮肉犬糧 - 鯖魚羊肉', 'ZiwiPeak 巔峰', '飼料', '一般乾糧', 0, -1, '●96%超高含肉量●採用雙階段模擬自然風乾技術●嚴選100%紐西蘭野生鯖魚＆紐西蘭自然放牧草飼羊●豐富Omega3 & 6脂肪酸●皮膚毛髮健康更加亮麗●推薦給追求亮麗毛髪的狗寶貝'),
(154, '初牧頂級鮮羊乳', '陪心寵糧', '零食', '牛奶飲品', 0, -1, '●嚴選乳源，成分單純，口口濃醇香●豐富礦物質鉀、鈣、鎂，骨骼發育、鈣質補充●脂肪顆粒較牛奶小，毛孩腸胃更好吸收●豐富維生素『葉酸』，有效利用蛋白質及胺基酸●絕無添加澱粉、穀物、香精、色素、防腐劑●已投保產品責任險，適合全齡犬貓食用'),
(155, '老犬無穀配方 放養雞肉+新鮮蔬果', 'ACANA愛肯拿', '飼料', '無榖乾糧', 0, -1, 'ACANA的老犬配方富含放養雞的肉，蛋及馬鈴薯，從溫哥華島撈補的野生比目魚及卑詩省Okanagan谷的蔬果，每日搶鮮運送且不含防腐劑，以達到獨一無二的營養及最佳風味。傳承加拿大豐饒的農、漁業文化，運用當地的新鮮食材，為七歲以上的老化中狗狗製作高動物性蛋白質的飲食以維持肌肉量，限制造成體重負擔的碳水化合物，是一款為老齡犬設計的全方位營養生物學性飼糧。低卡路里、低脂低碳水化合物，卻不影響身體所需的全方位營養，是一款幫助維持好代謝的生物學性飼糧。●使用亞伯達農場自由放養的雞肉及巢蛋、北溫哥華群島捕撈的野生鯡魚、比目魚，低溫烘焙鮮肉，完整保留肉類及蔬果的香氣與營養，一開袋就能聞到濃厚肉香，大大提升適口性●高蛋白、低GI、低碳水化合物，並提供高齡犬老化階段完整均衡的營養●從豐富的魚類中攝取Omega-3及Omega-6，不但能保養心血管，對於心臟、免疫系統、大腦發育也非常有助益●從豐富的野生魚類中攝取的優質DHA及EPA，從飲食中保健腦部及眼部●針對高齡犬關節退化問題，每公斤含有高達1500mg的葡萄糖胺及900mg的軟骨素，幫助老化中的狗狗從飲食中保護、強化的關節●從各種新鮮蔬果幫助提供完整均衡的營養 ，添加東南瓜及南瓜提供可溶性纖維外，更添加腸球菌，大大提升腸胃消化機能，蜀葵根及完整蔓越莓、藍莓添加，幫助維持泌尿道健康。 薑黃、菊苣根、牛蒡根…等多項高營養價值草本植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害'),
(156, '成犬 經典系列乾糧 - 小顆粒羊肉 (毛髮柔亮配方)', '優格', '飼料', '功能配方', 0, -1, '●Omega 3脂肪酸-幫助毛髮柔亮，維持細胞健康●蕬蘭精華-減輕便臭，降低異味●腸益菌/益菌生-整腸助消化，使營養好吸收'),
(157, '鄰居貓 全方位營養肉泥', '朝貢 조공', '零食', '肉泥', 0, -1, '針對浪浪毛孩作為主要餵食對象，對於與家人一起生活的狗貓營養成分可能會有些過多較不推薦使用●一條熱量約10kcal●朝貢鄰居貓的出發點為幫助浪浪毛孩們更均衡的營養需求！●使用100%無抗生素雞胸肉作為主要蛋白質！●富含歐米茄-3、維生素Ｂ、牛磺酸、鈣、必須胺基酸。●對狗狗和貓貓來說，在體內合成的營養只有通過食品攝取，但是由於沒有家人，食品攝取有限的孩子很難得到必須的營養素，因此開發出此款肉泥。●使用英國DSM公司的維生素-朝貢鄰居貓的維生素使用世界最大的非拉明製造商英國DSM公司●朝貢獨有的維生素混合-不使用市售的維生素混合物●通過與韓國內知名專家、教授團隊等多所高校的緊密合作，調節出不同產品中維生素的比例，製造出朝貢獨有的維生素混合物'),
(158, '寵物保健品 - 心情超好', 'Hyperr 超躍', '保健', '紓壓抗焦慮', 0, -1, '●心情超好 舒壓、放鬆好心情●嚴選國際大廠專利成分●調配有效複方●專業獸醫師推薦'),
(159, '高齡犬 經典系列乾糧 - 羊肉 (高纖低脂配方)', '優格', '飼料', '一般乾糧', 0, -1, '●茄紅素/VitE-抗氧化　維持健康免疫力●葡萄糖胺/軟骨素　幫助關節靈活，骨質保健●左旋肉鹼　維持良好體態 體重控制'),
