(166, '貓狗手作零食 (多種口味)', '自然食', '零食', '肉乾肉條', 0, -1, '狗貓寵物零食推薦，牛絞肉混入適量亞麻籽，製作成條狀，狗狗貓咪更好入口！低溫烘烤後混合著亞麻籽的植物清香，還可以幫毛孩補充膳食纖維，幫助犬貓腸道保健！GanedenBC30專利芽孢乳酸菌+LJ88約氏乳桿菌+日本專利LTK竹內乳酸菌，共三大專利菌及16支複合乳酸菌'),
