(171, 'SUBZERO 黑鑽頂級無穀凍乾糧 - 全齡犬 七種海洋魚', '紐崔斯', '飼料', '無榖凍乾', 0, -1, '●頂級高蛋白無穀糧+凍乾營養鮮肉粒●優質鮮肉+鮮魚蛋白質●低升醣碳水化合物●北美盛產蔬菜水果●椰子油&營養豐富的草本植物'),
