(175, 'PETHROOM果凍繽紛袋 寵物藏食發聲玩具', 'PETHROOM', '玩具', '發聲玩具', -1, 0, '●繽紛袋內含四種玩具●迷你口袋,可以藏食●花瓣和櫻桃果實發出沙沙聲、心形軟糖內藏着可隱藏零食的針織布●小熊軟糖玩具內置了嗶嗶聲●柔軟材質,牙齒較弱的朋友們也可以玩●果凍袋正面全部都是沙沙作料,刺激毛孩朋友們的好奇心'),
