(211, '成長機能主食餐包 (多種口味)', '自然食', '罐頭', '鮮食餐包', 0, -1, '毛孩自離乳後，營養的主要來源從媽媽的母乳逐漸轉換成好吞嚥、易消化的固態食物。在正式進入成年以前的毛孩，在體型、身體各系統的發育上，正急速的改變，為了滿足毛孩該時期的成長需求，食物補充的重要性絕對不能忽視。●營養補充：高優質蛋白好吸收、鈣鋅鎂成長關鍵元素●腸道健康：益生質促進腸道健康●免疫維持：添加DHA/靈芝多醣體，助頭好壯壯/免疫維持●容易吸收：質地綿密更好吸收，適合敏感寶寶使用時機：1. 離乳後日常主食2. 成長期營養補充3. 濕食訓練4. 促進食慾5. 體弱恢復期'),
(212, '隨行斜挎小包 (兩色)', 'HiDREAM', '外出', '外出包', -1, 0, '● 寬大口徑 收拿方便● 正面袖口 隨取隨用● 可調節肩帶長度● 尼龍材質 髒污好打理'),
