(257, 'BITE ME造型發聲玩具 - 椒椒與你', 'BITE ME', '玩具', '發聲玩具', -1, 0, '●身材嬌小的寶貝,也能一口咬住的新乳膠玩具！●來自泰國的天然乳膠製成,厚實口感讓寶貝一咬就上癮●啾啾聲屬於較小聲的類型,玩起來比較不會有壓力唷●怕吵的爸爸媽媽可以選擇這一款玩具●超可愛的椒椒與你,放在家當擺設也超可愛'),
(258, '花花拾便器套裝', '未卡', '外出', '外出道具', -1, 0, '● 綠色環保 便捷使用● 可與任何牽引繩搭配● 環保材質 可分解 無污染● 任性加厚 不破不漏'),
(259, '主食凍乾熟食餐 - 糙米無麩 (多種口味)', '小犬威利', '飼料', '一般凍乾', 0, -1, '●狗狗均衡主食●加水1步驟，營養美味真簡單●非基改糙米，無麩低敏●獨家營養包覆技術，保存完整營養素●選用人類級食材●專業動物科學營養配方，符合 AAFCO／NRC 主食營養標準'),
(260, 'BITE ME藏食發聲玩具 - 毛巾系列 (啾啾聲、嗅聞)', 'BITE ME', '玩具', '發聲玩具', -1, 0, '藍色毛巾：用啾啾聲來開啟一場演奏大會吧！瘋狂喜歡啾啾聲玩具的朋友們,藍色毛巾一口氣放入九個啾啾聲,讓你玩個盡興~最後還追加了一條響紙沙沙聲。使用低刺激魔鬼氈,將多個毛巾相互黏上,還可以變成一個大型嗅聞玩具哦！粉色毛巾：第一屆嗅聞大會開始了~粉色毛巾設計了不同的藏食口袋,除了可以藏長型零食,還有棉布條可以藏,讓寶貝享受一點點找尋的快樂。最後還有四個口袋設計,可以一口氣藏超多零食的！讓難易度UP！UP！使用低刺激魔鬼氈,將多個毛巾相互黏上,還可以變成一個大型嗅聞玩具哦！'),
(261, '折疊式寵物單肩包', 'PETSEEK', '外出', '外出包', -1, 0, '●大空間 通風透氣●摺疊收納 居家外出●加大空間 寵愛牠'),
(262, '無穀區域頂級食材主食糧 - 放養雞肉 X 火雞肉', 'ACANA愛肯拿', '飼料', '一般乾糧', 0, -1, '●對飲食較敏感的狗狗，研製單一肉類蛋白來源的飼糧，利用專利WholePrey™比例，提供給毛孩天然營養，減少狗狗對合成維生素及胺基酸的造成的敏感●傳承加拿大豐饒的農、漁業文化，運用當地的新鮮蔬果、亞伯達農場自由放養的雞肉、火雞肉、巢蛋及北溫哥華群島捕撈的野生鼓眼魚、鱒魚，製作出高達70%高肉含量的營養配方●多元且豐富肉類蛋白，低溫烘焙完整保留鮮肉及蔬果的香氣及營養，一開袋就能聞到濃厚肉香，大大提升適口性●每公斤有高達700mg的葡萄糖胺及1500mg的軟骨素，可從飲食中保護、強化關節●除了蘋果、梨子等多種新鮮蔬果提供完整均衡的營養，更添加冬南瓜及南瓜提供可溶性纖維，大大提升腸胃消化機能；添加蜀葵根及完整蔓越莓、藍莓，幫助維持泌尿道健康●薑黃、玫瑰果、菊苣根、牛蒡…等多項高營養價值植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害●水飛薊、薰衣草、苜宿等有機海洋蔬菜與草本植物，幫助促進新陳代謝。'),
(263, 'POOZPET狗用網球玩具 - 咖啡豆袋', 'POOZPET', '玩具', '啃咬玩具', -1, 0, '●耐撕耐咬 自帶塑料簌簌聲●天然橡膠內膽 內置發聲器●高彈耐咬 做工精致●互動接拋 所有狗狗'),
(264, 'AGILE 寵物推車 (多色)', 'FikaGO', '外出', '外出推車', -1, 0, '● 單手操作 手車可站立● 前後雙開 高景觀視野● 巧小體積 平整好收納● 全車避震 前輪可定向● 寬敞座艙 舒適毛孩乘坐● 實用美學 北歐質感設計'),
(265, 'S2 幼犬 均衡健康系列 雞肉+燕麥', '紐頓', '飼料', '一般乾糧', 0, -1, '●採用高纖食材，幫助消化，增加飽足感●不含馬鈴薯及木薯澱粉●21種天然草本蔬果食材的最佳搭配組合，給予寵物完整需求●最佳動物肉類蛋白+南瓜與生薑，高吸收率●採用鮭魚油加亞麻籽，含有豐富的Omega-~3幫助皮毛亮麗'),
(266, 'LINSLINS基礎款 結繩玩具', 'LINSLINS', '玩具', '啃咬玩具', -1, 0, '●優選材質 耐磨耐咬 ●解壓玩具同時增加運動量 ●磨齒工具 培養正確啃咬習慣 ●增進人寵感情 ●多種配色 隨心挑選'),
