(270, '有機清潔護理系列 - 防蚊驅蟲噴霧', 'made of organics', '外出', '外出道具', -1, 0, '●除了檸檬香茅油、印楝油等基礎油之外，我們還添加了比避蚊胺更持久的綠花白千層油●含有大量親膚有機蘆薈、有機金盞花等天然植物成分，即使是皮膚敏感的狗狗也可以放心使用●不含酒精的防蚊噴霧，不會刺激狗狗的嗅覺●獲得ACO認證！經第三方測試的驅避效果'),
(271, '全齡犬無穀低敏⽝糧 (多種口味)', '陪心寵糧', '飼料', '無榖乾糧', 0, -1, '●不含黃豆玉米小麥等高過敏源物質●單一動物性肉源(鱈魚)和易消化的碳水化合物●高蛋白、高脂肪、低碳水化合物.確保體內能量平衡配方設計●添加優質魚油，提供Omega-6脂肪酸和Omega-3脂肪酸卵磷脂，可維持皮毛良好狀態●優質蔬菜水果，含有維他命及礦物質等豐富營養素●半乳寡糖、山藥萃取物等腸道保健品●腸道保健益生菌含靈芝多醣15%，維持毛孩保護力'),
