(273, 'X 皮克斯 胸背帶牽引繩套裝 - 熊抱哥', '未卡', '外出', '外出道具', -1, 0, '● 穿上熊抱哥胸背 一起環遊世界● 甜酷出行 點亮好心情● 針對狗狗身形設計 有效防掙脫'),
