(280, 'SHN 健康體型乾糧 – MNINP 小型室內幼犬', '法國皇家', '飼料', '一般乾糧', 0, -1, '●強化免疫力支持大腦發育●幫助腸道菌叢維持平衡●三角形顆粒●富含天然抗氧化物●不添加人工防腐劑、色素及香料'),
(281, 'VD-10 Vet Life 犬用心血管配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●添加大量牛磺酸、左旋肉鹼與omega-3脂肪酸●使用易消化、高吸收率的水解魚肉蛋白有助於心血管保健●降低鈉含量並適量增加鉀離子維持電解質平衡●符合心臟問題犬隻營養需求●本品為心臟病犬專用之處方食品，需在獸醫師評估下使用，可作為主食。'),
(282, '摺疊矽膠隨行碗 (多色)', 'HiDREAM', '外出', '飲食用品', -1, 0, '● 可折疊的寵物矽膠隨行碗● 食用級別矽膠，無毒無異味● 室內室外裝水裝糧，狗貓通用'),
