(285, '寵兒愛喝水 - 高溶氧水', '舒服樂', '零食', '牛奶飲品', 0, -1, '●高含氧量●無菌●小分子團●無塑膠微粒●品質認證'),
(286, '即期品專區 - 狗狗冷凍乾燥生食餐', '汪喵星球', '飼料', '一般凍乾', 1, -1, '●效期至 2024/7/28 凍乾生食餐，營養吃、方便餵●生食的營養x乾乾的方便●可當作每日主食●使用「冷凍乾燥技術」製作，可常溫保存，使用常溫配送'),
(287, '96% 鮮肉犬糧 - 羊肉', 'ZiwiPeak 巔峰', '飼料', '一般乾糧', 0, -1, '●96%超高含肉量●採用雙階段模擬自然風乾技術●嚴選100%紐西蘭自然放牧草飼羊●皮膚毛髮健康更加亮麗●維持自然抵抗力●適合皮膚易敏感的狗寶貝'),
(288, '寵物零食肉丁 (多種口味)', 'Peperoni', '零食', '凍乾拌料', 0, -1, '●質地柔軟，高齡犬也能咬得動！●含有維生素Ａ'),
(289, '鮮雞高齡犬 無穀配方', 'Orijen 歐睿健', '飼料', '無榖乾糧', 0, -1, '●ORIJEN含38%豐富蛋白質，19%低升醣的碳水化合物，根據所有品種及生長階段的狗的生理需求，完整滋養您的愛犬。●ORIJEN裡2/3的肉是新鮮（冷藏、不加防腐劑）或生鮮（急速冷凍、不加防腐劑）的肉，是其他品牌的狗食品無法比擬的。●1/3的肉為新鮮雞肉、火雞肉及魚類，以90度低溫進行溫和脫水，供給鮮肉無法單獨提供的豐富蛋白質。●滿滿營養的完整獵食比例鮮肉、內臟和軟骨，加上完整魚類和新鮮全蛋，完美滿足高齡犬的營養需求。●加入冷凍乾燥肝臟，大幅提升適口性，ORIJEN美味無比，就連最挑食的狗都無法拒絕。'),
(290, '高齡犬 經典系列乾糧 - 鮭魚 (熟齡養生配方)', '優格', '飼料', '一般乾糧', 0, -1, '●茄紅素/VitE-抗氧化　維持健康免疫力●葡萄糖胺/軟骨素　幫助關節靈活，骨質保健●Omega3/DHA-護毛髮 促進腦神經健康'),
(291, '凍乾點心 (多種口味)', '小犬威利', '零食', '凍乾拌料', 0, -1, '●100%純肉優質蛋白質●開封即食小零嘴，搭配鮮食美味多變●挑嘴剋星，補水聖品●選用人類級當令食材●適溫熟化，完整殺菌'),
(292, '寵物保健品 - 排毛超好', 'Hyperr 超躍', '保健', '化毛', 0, -1, '●溫和排毛無負擔●排便順暢好健康●代謝體內髒東西●專業獸醫推薦'),
(293, '全齡犬 零穀系列乾糧 - 羊肉+鮭魚 (敏感配方)', '優格', '飼料', '無榖乾糧', 0, -1, '●極致零穀配方-純天然不含人工香料、色素與防腐劑●優質蛋白質-來自羊肉與鮭魚，提供完整的胺基酸與蛋白質●鲜採 5 種蔬果-含豐富維生素、礦物質與抗氧化物，維持自然抵抗力'),
(294, '慢燉系列肉泥 (多種口味)', '朝貢 조공', '零食', '肉泥', 0, -1, '朝貢系列是使用中藥材和不添加殘肉的蛋白質零食。按照傳統方法，在製作湯藥的甕中精心熬煮8個小時，味道溫和且水分含量高，可同時提供足夠的水分及豐富的營養。'),
(295, '寵物益生菌 - 體態管理', '汪喵星球', '保健', '體重控制', 0, -1, '●犬貓適用，平衡胖瘦菌叢，打造易瘦體質●益生元+白腎豆萃取物，穩定血糖血脂●膳食纖維助腸胃蠕動，清理宿便'),
(296, 'SHN 健康體型乾糧 – XSA+8 超小型熟齡犬8+歲', '法國皇家', '飼料', '一般乾糧', 0, -1, '●活力支持●特別設計的抗氧化物複合配方●幫助維護腸道健康●為迷你型犬易便秘體質設計●迷你型顆粒設計特別適合迷你型犬食用●幫助維持泌尿道健康'),
(297, '鮮肉凍乾零食 (多種口味)', '派庫廚房', '零食', '凍乾拌料', 0, -1, '●均衡飲食增加額外營養成分●100%純肉適口性佳●原肉製造更香更誘惑●加水還原鮮肉增加水分攝取●低溫冷凍乾燥技術台灣製造'),
(298, '犬寶變不臭(益生菌)', '木入森', '保健', '消化保健', 0, -1, '● 豐富60億有益菌合狗狗需求● 加強腸道免疫力● 改善消化吸收● 減少排便異味'),
(299, 'CCN 敏感保健乾糧 - DMMN 皮膚保健 小型成犬', '法國皇家', '飼料', '功能配方', 0, -1, '●小型指成大體重10公斤以下●水解蛋白配方 呵護皮膚健康●提供精準均衡營養●幫助維持皮膚健康●豐富0mega-3與omega-6●富含GLA、EPA+DHA●小顆粒，大學問 量身訂製的專屬顆粒'),
(300, '原肉零食 (多種口味)', '汪喵星球', '零食', '凍乾拌料', 0, -1, '汪喵凍乾小零嘴可常溫保存，因採用目前最好的「冷凍乾燥技術製作」除食材本身營養無其他添加物，給毛孩自然無負擔的寵愛。以上圖文資訊來源：汪喵星球官方網站https://www.dogcatstar.com/'),
(301, '犬寶痕淨白', '木入森', '保健', '視力保健', 0, -1, '●專業去痕，淨白配方●眼睛、鼻子、免疫、菌源 4重守護●鮮甜雞肉味膠囊粉，好餵食'),
(302, '鮮雞小型幼犬 無榖配方', 'Orijen 歐睿健', '飼料', '無榖乾糧', 0, -1, '●85%優質家禽和魚類肉含量，提供必需胺基酸、維生素和礦物質●WholePreyTM 完整獵食，使用肉類、內臟、可食性骨頭，模擬出一頭完整的獵物營養●加入新鮮蔬果和草本植物，提供可溶性纖維，促進消化功能和穩定腸胃●無穀物、木薯粉、馬鈴薯、濃縮性植物蛋白，符合健康營養需求●飼料裹上肝臟凍乾塗層，提升適口性，讓幼犬愛不釋口●小型幼犬專屬飼料顆粒尺寸，方便幼犬進食'),
(303, '冷凍乾燥零食 隨身包系列 (多種口味)', '牠說好吃', '零食', '凍乾拌料', 0, -1, '●留存食材本身營養●輕巧、方便攜帶儲存●低碳水、低脂肪●使用原肉純天然零添加●鬆軟質地適合各年齡犬貓'),
(304, 'Omega-3 全保養魚油 - 噴霧型', '汪喵星球', '保健', '綜合營養', 0, -1, '全台首創噴霧型魚油讓保存、保養都簡單！●單方保健 X 單一小型魚種，減少毛孩過敏機率●ORIVO 認證溯源魚油，高純度又安心●無氧噴瓶填充，用到最後一刻都能常保新鮮'),
(305, '無穀養生犬用乾糧 – 全齡犬 火雞肉X雞肉X鯡魚', '紐崔斯', '飼料', '無榖乾糧', 0, -1, '●0穀類 豐富鮮肉+多樣蔬果●低敏配方●低升醣碳水化合物●優質蛋白質來源●北美盛產蔬菜水果●椰子油&營養豐富的草本植物'),
(306, '狗狗香軟凍乾 (多種口味)', 'SOFTREAT', '零食', '凍乾拌料', 0, -1, '●針對狗狗特性而設計SOFTREAT狗狗香軟凍乾●採用最天然且無添加食材而製成●設計成適合狗狗吞嚥與消化●鬆軟易食、好消化、採獨立小包裝●一次一包、一盒有15包，易於保存與攜帶●非常適合作為玩耍時的獎勵或是訓練用零食●可以打碎拌在食物或水中來增加狗狗食慾、飲水量');
INSERT INTO `product` (`id`, `name`, `brand`, `cate_1`, `cate_2`, `is_near_expired`, `is_refurbished`, `description`) VALUES
(307, 'Plus+機能保健系列 腸胃保健益生菌', '陪心寵糧', '保健', '消化保健', 0, -1, '● 10種高效菌種+26種天然蔬果酵素『1+1>2!』● 專利天然包埋結構，耐膽鹽、胃酸● MIT台灣研發專利益生菌● 維持腸道健康，幫助好菌生長、幫助消化！'),
(308, '田園犬用糧 – 小型成犬 雞肉', '紐崔斯', '飼料', '一般乾糧', 0, -1, '●優選雞肉+低升糖糙米●北美盛產蔬菜水果●不飽和脂肪酸'),
(309, 'BITE ME造型發聲玩具 - 動動', 'BITE ME', '玩具', '發聲玩具', -1, 0, '擁有彈力無窮的身體和可愛微笑的臉蛋,是每個毛小孩拉扯玩樂的完美夥伴！兩頭都有啾啾聲,更可以吸引毛小孩的興趣變長的彈力橡皮筋,請盡情地享受拉繩遊戲。柔軟的觸感材質和馬卡龍配色,讓寶貝在嬉戲時也能可可愛愛！中、大型犬寶貝絕對不能錯過的可愛互動玩具'),
(310, '即期品專區 - Plus+功能型機能粉 腸道保健', '陪心寵糧', '保健', '消化保健', 1, -1, '● 適合腸道敏感，容易有軟便、排便不順的狗狗● 六種複方益生菌ｘ益生質ｘ綜合蔬果酵素的黃金組合● 有效改善腸道菌叢生態，幫助好菌生長，維持消化道機能'),
(311, '無穀鮮肉糧佐凍乾 - 犬用 (多種口味)', 'Hyperr 超躍', '飼料', '無榖凍乾', 0, -1, '●74% 高含肉量，特選加拿大新鮮全雞肉及北美超級蔬果●添加紐西蘭凍乾牛肉，富含蛋白質與胺基酸，提升整體營養●顆粒飼料+凍乾，雙重口感，肉香濃郁，增添食慾●依循AAFCO全年齡營養標準打造，滿足狗狗日常所需營養'),
(312, 'Brightkins寵物益智藏食盤 - 起司堡', 'Brightkins', '玩具', '益智玩具', -1, 0, '●Brightkins 美國益智玩具●使用不含雙酚A的安心塑料製成●為寵物們帶來生動的學習體驗●增強智力刺激 促進活躍遊戲●激發寵物的好奇心 讓整個家庭都參與其中'),
(313, '泌尿道保健粉', '毛孩時代', '保健', '泌尿保健', 0, -1, '● CranPure 五項專利蔓越莓 足量Ａ型原花青素● 美國40年DDS-1專利泌尿道益生菌● 專利UTI-Best 洛神花 西班牙專利南瓜籽'),
(314, '成犬無穀 雞肉', 'HALO 嘿囉', '飼料', '無榖乾糧', 0, -1, '●加倍益生菌 更好消化●最接近鮮食的乾糧●純鮮肉 0添加肉粉'),
(315, 'FandoraX 貓貓蟲咖波 寵物玩具', 'Fandora', '玩具', '發聲玩具', -1, 0, '●可發聲 可藏食●內藏發聲器●肉肉的骨頭還能分離'),
(316, '禪靜抗焦慮 - 口服液', '法國法典', '保健', '紓壓抗焦慮', 0, -1, '● 內含L-色胺酸，幫助動物生成血清素(神經傳遞物質)● 有助於平息過度興奮、緊張或焦慮的犬貓方● 無副作用、無成癮性● 高適口性，天然營養補充品'),
(317, '紐西蘭無穀成犬糧 - 太平洋鯖魚', '本牧', '飼料', '無榖乾糧', 0, -1, '●非基因改造成分●無穀低敏感配方●100%紐西蘭肉源●無抗生素、無生長促進劑、無人工香料或色素●人道自由放牧'),
(318, 'Brightkins寵物漏食玩具 - 杯子蛋糕', 'Brightkins', '玩具', '益智玩具', -1, 0, '●Brightkins 美國益智玩具●使用不含雙酚A的安心塑料製成●為寵物們帶來生動的學習體驗●增強智力刺激 促進活躍遊戲●激發寵物的好奇心 讓整個家庭都參與其中'),
(319, '寵立善保健品 - 綜合完整型營養粉', '自然食', '保健', '綜合營養', 0, -1, '●法國酵母螯合型維生素，經由酵母螯合轉化的天然營養素，更安全、生物利用率更高！●美國全食物型態胜肽載體維生素，萃取自天然食材，新胜肽載體技術大幅提高吸收率。●天然純淨海洋深層水，經由離子透析技術分離出利於吸收的離子態礦物質，生物利用率極高，是每日營養補充的最佳來源。●綜合維生素採用全球營養品知名品牌 DSM 高品質原料，所有的原料皆生產於符合歐美法規經過嚴格控管，品質保證。●安全、天然、適口性更佳，沒有化學合成的人工怪味。●依照NRC國際營養標準調配，滿足犬貓每日營養必須。'),
(320, '特調配方糧 - 羊肉 X 雞肉 X 糙米 (全齡犬)', '柏萊富', '飼料', '一般乾糧', 0, -1, '●低溫慢火烹調，降低便量與便臭●天然優質羊肉蛋白質，幫助呵護敏感皮毛●多種益生菌與果寡糖，幫助保健腸道●高含量亞麻油酸，幫助護膚亮毛●豐富蔬果精華天然抗氧化劑，維持抵抗力●不含玉米，小麥，黃豆'),
(321, 'FAD Plus汪汪耐咬發聲玩具 - 農場乳牛', 'FAD Plus', '玩具', '啃咬玩具', -1, 0, '來自日本的FAD+無毒安全玩具,每個玩具都經過歐盟EN71 part 3 玩具安全認證,通過無重金屬殘留測試,讓寶貝玩得更安心！FAD+春夏超可愛農場系列乳牛是叮叮鈴噹聲寶貝可以享受不同的聽覺刺激,挑選最喜歡的農場動物唷'),
(322, '寵物外出包 - 紫羅蘭之旅', '未卡', '外出', '外出包', -1, 0, '● 迷人新色 開啟優雅之旅● 超大空間 躺臥自如● 收放自如 秒變寬敞● 三面大開口 靈活進出才方便'),
(323, '極鮮無穀全齡配方糧 - 鯡魚 X 火雞肉 X 扁豆 (小型成犬均衡)', '柏萊富', '飼料', '無榖乾糧', 0, -1, '●低溫慢火烹調，降低便量與便臭●高優質天然去骨鯡魚肉及火雞肉，雙重肉類適口再升級●100%無穀配方，減少食物過敏機率●高含量亞麻油酸，幫助護膚亮毛●添加天然椰子油，維持抵抗力及關節健康●苜蓿富含胡蘿蔔素，保護眼睛●多種益生菌與果寡糖，幫助保健腸道'),
(324, 'BITE ME造型發聲玩具 - 愛鏟你', 'BITE ME', '玩具', '啃咬玩具', -1, 0, '●身材嬌小的寶貝,也能一口咬住的新乳膠玩具！●來自泰國的天然乳膠製成,厚實口感讓寶貝一咬就上癮●啾啾聲屬於較小聲的類型,玩起來比較不會有壓力唷●怕吵的爸爸媽媽可以選擇這一款玩具●超可愛的椒椒與你,放在家當擺設也超可愛'),
(325, '寵物背包', 'pidan', '外出', '外出包', -1, 0, '輕便、通透、超易用的pidan寵物出行背包！●前所未有大尺寸●可背、可拎、還有拉桿箱專用綁帶●折疊收納，花樣出行●超大視窗●頂面大孔徑透氣網格佈設計，拒絕悶熱！'),
(326, '無穀配方犬用乾糧 - 鮭魚 X 鯡魚 X 曼哈頓魚', 'Nurture PRO 天然密碼', '飼料', '無榖乾糧', 0, -1, '●82%動物性蛋白質●0%穀物、麩質、副產品●低溫慢火烘焙●10種天然超級食材●益生菌及益菌生加強保護●添加椰子油、鮭魚油及月見草籽油'),
(327, 'FAD Plus汪汪耐咬發聲玩具 聖誕馴鹿 (節日限定款)', 'FAD Plus', '玩具', '啃咬玩具', -1, 0, '【聖誕節限定】來自日本的FAD+無毒安全玩具每個玩具都經過歐盟EN71 part 3 玩具安全認證通過無重金屬殘留測試,讓寶貝玩得更安心！●雙層布料、雙倍耐咬,內層獨有牛津布緊密貼合,更加耐咬●內層車縫線精密縫合,抗拉扯能力更加強大,延長玩具使用壽命●採用立體電繡工藝,讓紋理擁有立體感●啾啾聲吸引寶貝好奇心,持續玩耍●材質方便清洗,易洗易乾●通過歐盟EN-71 part 3 玩具 無八大重金屬殘留 安全認證'),
(328, '多功能摺疊便攜手提包 (兩色)', 'PETSEEK', '外出', '外出包', -1, 0, '●所謂的，一包三用●手提、跨包、雙肩包 任意出行 一包三用●僅1.29kg 搭配五公斤以內寵物 輕便容量大●底墊支撐 外出更穩固●三面通風 透氣不悶熱●超萌探頭設計 隨時關注&摸貓'),
(329, '室內犬無穀配方 放養雞肉+新鮮蔬果', 'ACANA愛肯拿', '飼料', '一般乾糧', 0, -1, '●ACANA的低卡輕盈配方因應肥胖犬的營養需求，足量蛋白質，維持必須肌肉質量和滿足食慾●限制脂肪與碳水化合物含量，有助於體內脂 肪燃燒，幫助減重●富含來自加拿大當地農場的放牧雞肉與全蛋，從北溫哥華島野生捕撈的比目魚，和種植於奧肯納根谷，並由陽光熟成的蔬果●提供當地整顆燕麥作為低升醣碳水化合物來源，幫助維持血醣穩定●食材每日新鮮配送。●由屢獲殊榮的加拿大寵物廚房蒸煮而成●傳承加拿大豐饒的農、漁業文化，愛肯拿運用當地的新鮮食材，為體重超標的狗狗製作高蛋白質的飲食以增加肌肉量，低卡路里、低脂低碳水化合物，卻不影響身體所需的全方位營養，是一款幫助維持好代謝的生物學性飼糧。●使用亞伯達農場自由放養的雞肉及巢蛋、北溫哥華群島捕撈的野生鯡魚、比目魚，低溫烘焙鮮肉，完整保留肉類及蔬果的香氣與營養，一開袋就能聞到濃厚肉香，大大提升適口性。●高蛋白、低脂肪含量，有助健康減重。●從豐富的魚類中攝取Omega-3及Omega-6，不但能保養心血管，對於心臟、免疫系統、大腦發育也非常有助益。●從豐富的野生魚類中攝取的優質DHA及EPA，從飲食中保健腦部及眼部。●每公斤有高達1500mg的葡萄糖胺及1000mg的軟骨素，高含量幫助過胖狗狗從飲食中保護、強化關節。●從各種新鮮蔬果幫助提供完整均衡的營養 ，添加東南瓜及南瓜提供可溶性纖維外，更添加腸球菌，大大提升腸胃消化機能，蜀葵根及完整蔓越莓添加，幫助維持泌尿道健康。●薑黃、菊苣根、牛蒡根…等多項高營養價值草本植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害。'),
