(335, 'LD-5 老犬 雞肉石榴 天然低穀系列', 'Farmina 法米納', '飼料', '一般乾糧', 0, -1, '●WDJ多年推薦、DFA五星級評等●使用低升糖成份-斯佩爾特小麥、燕麥●以好消化吸收的雞肉製成●限制蛋白質含量降低內臟的負擔●提升了葡萄糖胺與軟骨素的含量●另外添加抗氧化之王-石榴，使老年動物能夠得到最好的保健效果適用對象：老犬、熟齡犬'),
