(342, '毛孩蒸鮮常溫鮮食 (多種口味)', '飼糧倉', '罐頭', '鮮食餐包', 0, -1, '●高壓高溫滅菌 放心食用●真空包裝/拆封即食●全齡汪喵皆可食用/黑鮪魚丁丁●超絕新鮮東港海鮮風味搭配●嚴選鮪魚低溫烘乾製作，滋味鮮美●鮪魚含高蛋白質之外，含有豐富的不飽和脂肪酸及鐵、鉀等礦物質/厚切鮪魚排●超絕新鮮東港海鮮風味搭配●嚴選鮪魚低溫烘乾製作，滋味鮮美●鮪魚含高蛋白質之外，含有豐富的不飽和脂肪酸及鐵、鉀等礦物質/爆漿牛肉丸●牛肉－天然補鐵、優質蛋白質●膠原蛋白－保護關節、保持皮膚彈性且可促進傷口癒合●可以當零食餵食，也可以與主食混在一起，美味更出眾！/奇亞籽雞肉丸●選用認證本土低脂雞胸肉品，低脂肪高蛋白●奇亞籽－豐富的ω-3脂肪酸、Omega-3和維生素B●膠原蛋白－保護關節、保持皮膚彈性且可促進傷口癒合●堅持原味，保有天然食材水分/南瓜燒雞●選用認證本土低脂雞胸肉品，低脂肪高蛋白●雞胸肉蒸至軟熟，緊緊地鎖住美味！●南瓜－澱粉，增加飽足感、增加甜味●可以當零食餵食，也可以撕成雞絲與主食混在一起，美味更出眾！/原味鮮嫩雞柳●選用認證本土低脂雞胸肉品，低脂肪高蛋白●雞胸肉蒸至軟熟，緊緊地鎖住美味！●可以當零食餵食，也可以撕成雞絲與主食混在一起，美味更出眾！'),
