(344, '單一蛋白鮮肉乾糧 低敏犬 - 鴨肉', '安柏希雅', '飼料', '一般乾糧', 0, -1, '安柏希雅新鮮鴨肉配方是一款特別設計的寵糧，採用易消化的新鮮鴨肉提供優質蛋白質。添加橄欖油以及地中海水果和超級香草，打造低過敏性、希臘地中海健康飲食、無穀物的配方飼料。富含抗氧化食材有助於保護狗狗的健康，適合各種犬種。精心挑選的人類食用級成分，採用小型顆粒飼料，安柏希雅提供全面的營養，為您的狗狗帶來美味的口感和風味，讓牠們保持健康和快樂。'),
(345, 'VD-4 Vet Life 犬用腸胃道配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●使用雞肉、雞蛋、白米等極易消化、高品質的原料●搭配果寡糖、甘露寡糖等益菌生來增進腸內菌叢平衡●適量添加鈉鉀離子維護電解質平衡●添加燕麥、菊糖等各式纖維，同時搭配低脂配方維護腸道健康●本品為腸胃道疾病犬專用之處方食品，是具有較高鈉、鉀離子的高消化性飼料，需在獸醫師評估下使用，可做為主食。'),
(346, '閃閃熊LED散步燈 - 可充電式', 'BITE ME', '外出', '外出道具', -1, 0, '狗狗通常會在人視線較低的位置，在夜晚散步，容易被忽視容易與汽車和摩托車發生事故，或是被散步、跑步的行人撞到！不管任何犬種都可以輕鬆使用的閃閃熊有三種亮燈模式 1、快速閃爍 2、慢速閃爍 3、恆亮使用LFBB等級的100%安全矽膠，用在寶貝身上更柔軟安全不需要更換電池，使用Type-C充電孔，就可以輕鬆充電，循環使用囉！'),
(347, 'SUBZERO 黑鑽頂級無穀凍乾糧 - 小型犬 牛肉X羊肉', '紐崔斯', '飼料', '無榖凍乾', 0, -1, '●頂級高蛋白無穀糧+凍乾營養鮮肉粒●優質鮮肉+鮮魚蛋白質●低升醣碳水化合物●北美盛產蔬菜水果●椰子油&營養豐富的草本植物'),
(348, 'VD-11 Vet Life 犬用體重控制配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '●使用獨家斯佩爾特小麥和燕麥製成低升糖指數的配方●選用高品質蛋白質、左旋肉鹼及牛磺酸幫助肌肉發展●增加膳食纖維增添飽足感，同時降低脂肪含量減少熱量攝取，達到體重管理的健康目標●本品為肥胖症之犬專用處方食品，需在獸醫師評估下使用。可作為主食。'),
(349, '幻想家經典系列 - 隨行撿便袋收納盒 (多色)', 'KAMA MUTA', '外出', '外出道具', -1, 0, '● 享受每一次與你無畏懼的探索● 仿尼龍繩帶設計● 輕鬆固定耐磨損● 適用於各種牽引繩和包包'),
(350, 'VD-7 Vet Life 犬用泌尿道結石管理照護配方', 'Farmina 法米納', '飼料', '處方飼料', 0, -1, '使用適量硫酸鈣維護尿液酸鹼值，降低鈣、磷、鎂的含量，降低蛋白質含量，添加葡萄糖胺協助維護膀胱的黏多醣(GAG)保護層。本品為泌尿道磷酸銨鎂結石犬專用之處方食品，具有尿路酸化性質。需在獸醫師評估下使用，可作為主食。'),
