(386, '寵立善保健品 - 皮膚毛髮保健', '自然食', '保健', '皮膚保健', 0, -1, '毛孩皮膚問題，從根本改善最行泛紅、皮屑、搔癢，當心毛孩敏弱肌前兆皮膚是身體最大的器官，是抵禦外界刺激的第一道防線！健康的皮膚應有健康的角質層，倘若角質層受損，會影響皮膚的鎖水力及防禦能力。 當面臨外界環境的刺激原，毛孩就可能出現皮膚的敏弱症狀！有效提升三「肌」力，啟動健康「膚」循環●保水力神經醯胺構成角質細胞間油脂的主要成分，形成皮膚最外層的堅強防護網！能有效防止皮膚內層水分散失，穩定肌膚屏障功能，維持皮膚的健康、彈潤！●修復力Verisol®皮膚專利膠原蛋白經多項實驗證明，可針對皮膚、毛髮的健康，提供修復與再生的營養，重拾健康皮毛應有的柔順滑！●防禦力特別添加紫蘇萃取及Beta葡聚糖，幫毛孩從體內調節免疫力，增加抵擋對外界刺激的自然防護力，減少皮膚健康的失衡問題！高規格添加「Oricera®神經醯胺」，給毛孩的頂級保養、為皮膚健康提前部署1. 北海道天然玄米萃取 日本健康食品規格協會認證GMP工廠生產，台灣373項、日本800項農藥殘留檢驗合格，使用專利製程萃取，安全無毒，無使用化學溶劑。2. 足量添加、超過50位醫師推薦* 寵物保健品首度獲得日本原廠授權，達到有效實證劑量添加。專利原料並在日本獲得超過50位醫師推薦使用。3. 經口服試驗，可有效增加皮膚神經醯胺含量 年齡、壓力、環境刺激都會導致敏弱肌提前出現。經實證顯示，服用日本專利神經醯胺兩週後，可以增加角質層的神經醯胺含量，提高皮膚的含水量，強化皮膚屏障功能。'),
