(394, 'FAD Plus汪汪耐咬發聲玩具 聖誕老公公 (節日限定款)', 'FAD Plus', '玩具', '啃咬玩具', -1, 0, '【聖誕節限定】來自日本的FAD+無毒安全玩具每個玩具都經過歐盟EN71 part 3 玩具安全認證通過無重金屬殘留測試,讓寶貝玩得更安心！●雙層布料、雙倍耐咬,內層獨有牛津布緊密貼合,更加耐咬●內層車縫線精密縫合,抗拉扯能力更加強大,延長玩具使用壽命●採用立體電繡工藝,讓紋理擁有立體感●啾啾聲吸引寶貝好奇心,持續玩耍●材質方便清洗,易洗易乾●通過歐盟EN-71 part 3 玩具 無八大重金屬殘留 安全認證'),
(395, '寵物露營背包套裝組', 'FurryTail', '外出', '外出包', -1, 0, '●帶著愛寵逃離城市 奔赴野性浪漫●前所未有大尺寸●折疊收納 花樣出行●頂面大孔徑透氣網格佈設計 拒絕悶熱'),
(396, '小型成犬無穀配方 放養雞肉+新鮮蔬果', 'ACANA愛肯拿', '飼料', '一般乾糧', 0, -1, '●ACANA的配方富含豐富的放養雞肉，蛋及馬鈴薯，從溫哥華島撈補的野生比目魚及卑詩省Okanagan谷的蔬果●每日搶鮮運送且不含防腐劑，以達到獨一無二的營養及最佳風味●傳承加拿大豐饒的農、漁業文化，運用當地的新鮮食材，依據一歲以上的小體型成犬所設計符合生物學性主食。●使用亞伯達農場自由放養的雞肉及巢蛋、北溫哥華群島捕撈的野生鯡魚、比目魚，低溫烘焙鮮肉，完整保留肉類及蔬果的香氣與營養，一開袋就能聞到濃厚肉香，大大提升適口性，並將顆粒製作成適合小型犬咀嚼的大小●從豐富的魚類中攝取Omega-3及Omega-6，不但能保養心血管，對於心臟、免疫系統、大腦發育也非常有助益●從豐富的野生魚類中攝取的優質DHA及EPA，從飲食中保健腦部及眼部●每公斤有高達1400mg的葡萄糖胺及900mg的軟骨素，可從飲食中保護、強化關節●從各種新鮮蔬果幫助提供完整均衡的營養 ，添加東南瓜及南瓜提供可溶性纖維外，更添加腸球菌，大大提升腸胃消化機能，蜀葵根及完整蔓越莓添加，幫助維持泌尿道健康●薑黃、菊苣根、牛蒡根…等多項高營養價值草本植物添加，幫助狗狗抗氧化，有助於抵抗自由基對身體的傷害，薰衣草幫助草本抗菌、降脂'),
(397, 'LINSLINS寵物漏食玩具 - 魔法小兔帽', 'LINSLINS', '玩具', '益智玩具', -1, 0, '●用玩樂安撫分離時的緊張與不安●可藏零食設計 享受尋寶般的樂趣●減少寵物的破壞性 緩解壓力'),
(398, '胸背帶牽引繩 (六色)', 'MAOGOUBLUE', '外出', '外出道具', -1, 0, '鏟屎官與毛孩子的相遇就像在這個時空遇到屬於自己的精靈，為愛不朽。這一系列色彩靈感來源於“rainbow man”的藝術家Ramzy Masri的彩虹系列作品，將美好幸運的彩虹色與寵物牽引繩結合，採用材質的柔軟耐磨，與同色系的環扣渾然一體。有手牽、斜挎多種使用方始，解放雙手，讓毛孩子們與鏟屎官有更好的互動體驗。'),
(399, 'I18 I20 專業理想系列', '紐頓', '飼料', '功能配方', 0, -1, '【I18雞肉碗豆】●採用草本概念，多元而富含營養配方的食譜，從裡到外改善你寵物的健康●援助食物在消化系統裡的運動，延長飽足感，是控制體重的關鍵●添加鮭魚油和綠唇貽貝，所提供的Omega-3脂肪酸是消炎來源，以提高活動力【I20羊肉糙米】●採用草本概念，多元而富含營養配方的食譜，從裡到外改善寵物的健康●添加了鮭魚油，是EPA的豐富來源，增加自然抵抗力●迷迭香是最佳抗氧化劑，讓皮毛更亮麗'),
(400, '超大貓包 (兩色)', 'Mango', '外出', '外出包', -1, 0, '● 超大喵包 可橫可豎● 大容量 大空間● 前背視角 隨時安撫● 三面透氣窗 不憋悶● 雙面設計 隨意進出【商品規格】●材質：牛津布、PU皮革●尺寸：39x28x45cm●適用體重：10公斤以下'),
(401, '牛奶叭噗 發聲玩具', 'BITE ME', '玩具', '發聲玩具', -1, 0, '永遠不融化的牛奶叭噗，不管春夏秋冬都不會融化。搭配上威化餅乾脆脆的，真的很吸引毛孩。啾啾聲是溫柔版小小聲，推薦給喜歡不吵鬧的毛孩毛媽們！【注意事項】毛孩使用時，請飼主陪同，避免誤食。內含塑膠材質(啾啾聲)，建議以冷水洗滌。產品因包裝不同，使用前請先將包裝撕去。此為消耗性商品，嚴重撕咬導致產品破損時，請盡速將玩具收走，以免家中寶貝吞嚥內容物，若損壞應立即更換。產品請勿靠近火源。根據材質特性和測量方法的不同，會產生1-2cm的誤差。商品顏色因電腦螢幕設定不同而有誤差，以實際商品顏色為主。玩具屬接觸性商品，若非商品瑕疵(如:發聲器無法出聲、脫線等)，拆封後故無法退換貨及退款。出貨前皆會測試發聲器，拆封後若發現無法按壓出聲音，請立即反應給客服。');
